Defendant in custody.    
Defendant is before the Court for sentencing, his probation having been revoked effective 01-10-19.   
Defendant is sentenced to the Wisconsin State Prison System for a total sentence of five and one-half (5 1/2) years.    Two and one-half (2 1/2) years initial confinement, followed by three (3) years extended supervision.   Conditions of extended supervision are:   
1) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process; 
2) AODA assessment and follow through; 
3) Submit to random urine screens and pay for same; 
4) Maintain full-time employment/job serach combination; 
5) Pay costs of action; 
6) Pay supervision fees in an amount to be determined by DOC.   
Court finds the defendant is eligible for the Challenge Incarceration Program and for the Substance Abuse Program.   
Defendant is given credit for 205 days already served.    
Minutes.

Count 1 - Strangulation and Suffocation (DVO) - No contest plea.   Convicted.   State moves to dismiss and read in counts 2-6.   Motion granted.   Sentence is withheld.   Defendant is placed on probation to DOC for three (3) years.   Conditions of probation are:
1) Four (4) months jail, under the Huber Law, to commence upon the completion of the jail condition of probation in 16 CF 51;
2) Domestic violence assessment and follow through; 
3) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
4) Mental health assessment and follow through; 
5) Maintain full-time employment/schooling combination; 
6) Submit DNA sample; 
7) Pay costs of action; 
8) Pay supervision fees in an amount to be determined by DOC.  
